import { useState } from 'react';

import { UseDispatch } from 'react-redux';
import { addTodo } from '../redux/todos/todosSlice';

function Form() {
  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        className="new-todo"
        placeholder="What needs to be done?"
        autoFocus
      />
    </form>
  );
}

export default Form;
